import React, { useEffect } from "react";
import Proposition from "../../component/Proposition/Proposition";
import "./Main.scss";

const Main: React.FC = () => {

  useEffect(() => {
    fetch("https://google-translate1.p.rapidapi.com/language/translate/v2/languages", {
      "method": "GET",
      "headers": {
        "accept-encoding": "application/gzip",
        "x-rapidapi-host": "google-translate1.p.rapidapi.com",
        "x-rapidapi-key": "1d3b5b16a2msh7d414f6792e02e5p15a931jsnc5a4f28f53c4"
      }
    })
    .catch(err => {
      console.error(err);
    });
  }, []);

  return (
    <div className="page">
      <Proposition />

    </div>
  );
};

export default Main;
